import 'package:google_maps_cluster_manager/google_maps_cluster_manager.dart';import 'package:google_maps_flutter/google_maps_flutter.dart';import '../../../google_map/utils/cluster_utils.dart';import '../connector.dart';class CustomMapMarker with ClusterItem {  final String? id;  final Map<String, List<String>>? imageUrls;  final String? name;  final LatLng? latLng;  final LatLng? myLocation;  final BitmapDescriptor? icon;  final StatusValues? status;  final List<Connector>? connectors;  final String? tenantId;  CustomMapMarker({    this.id,    this.imageUrls,    this.name,     this.latLng,    this.myLocation,    this.icon,    this.status,    this.connectors,    this.tenantId,  });  @override  LatLng get location => latLng ?? const LatLng(0, 0);  LatLng? get userLocation => myLocation;}